typedef struct
{
  const char * Name;
  unsigned short Index;
  unsigned char Type;
  
  // Home Assistant metadata (NULL = use type-based defaults)
  const char * friendlyName;    // German display name, NULL = use Name
  const char * haComponent;     // "sensor" | "binary_sensor" | "text", NULL = derive from Type
  const char * haDeviceClass;   // "temperature" | "energy" | "", NULL = derive from Type
  const char * unit;            // "°C" | "kWh" | "", NULL = derive from Type
  const char * stateClass;      // "measurement" | "total_increasing" | "", NULL = derive from Type
  const char * icon;            // "mdi:thermometer" | "", NULL = derive from Type/Name
  const char * payloadOn;       // "on" | "ein", NULL = use "on" (for binary sensors)
  const char * payloadOff;      // "off" | "aus", NULL = use "off"
  
  // Flags
  bool isBlacklisted;           // true = skip all processing
  bool hasMetadata;             // true = use struct metadata, false = use defaults
} ElsterIndex;

typedef enum
{
  // Die Reihenfolge muss mit ElsterTypeStr übereinstimmen!
  et_default = 0,
  et_dec_val,       // Auflösung: xx.x / auch neg. Werte sind möglich
  et_cent_val,      // x.xx
  et_mil_val,       // x.xxx
  et_byte,
  et_bool,          // 0x0000 und 0x0001
  et_little_bool,   // 0x0000 und 0x0100
  et_double_val,
  et_triple_val,
  et_little_endian,
  et_betriebsart,
  et_zeit,
  et_datum,
  et_time_domain,
  et_dev_nr,
  et_err_nr,
  et_dev_id
} ElsterType;

typedef struct
{
  unsigned short Index;
  const char * Name;
} ErrorIndex;

